import React from 'react';
import ColorOptions from './ColorOptions';

function ColorTier2Options({ shapeName, onSelect }) {
  return (
    <div>
      <label>Màu sắc tầng 2:</label>
      <ColorOptions shapeName={shapeName} onSelect={onSelect} />
    </div>
  );
}

export default ColorTier2Options;
